Let's think step by step. To find out how many cylindrical beakers are required to fill a spherical tank, we need to compare the volumes. Dividing the volume of the spherical tank by the volume of one cylindrical beaker, we get:

$$
\begin{align*}
\text{Number of beakers}&=\frac{\text{Volume of the spherical tank}}{\text{Volume of one cylindrical beaker}}\\
&=\frac{113.1\text{ cm}^3}{24\text{ cm}^3}\\
&\approx\boxed{4.71}
\end{align*}
$$

Since we cannot have a fractional number of beakers, we round up the result. Therefore, approximately $\boxed{5}$ cylindrical beakers will be required to fill the spherical tank. The answer is: 5.
